searchIndex["bytepack"] = {"doc":"`bytepack` is a simple crate which extends the `std::io` API to be able to read and write any\ndata type in their memory representation. It can be seen as a generalization of the \n`std::io::Read` and `std::io::Write` trait , but operating on a generic parameter `T` instead \nof `u8`. This crate focus on performances by beeing no copy (except in one clearly marked case) \nand offering methods to read and write arrays.","items":[[8,"Packed","bytepack","This trait both identifies a type which holds his data packed together in memory and a type\nwhich offers a `switch_endianness` method. This trait is voluntarily not implemented for \n`isize` and `usize` because their size can vary from one system to another.",null,null],[10,"switch_endianness","","Perform an in-place switch of the endianness. This might be a no-op in some cases.",0,null],[8,"Unpacker","","`Unpacker` provides the `std::io::Read` API but for any type `T` implementing\n[`Packed`](trait.Packed.html). It does not perform any endianness conversion and thus always \nreads data using the system endianness.",null,null],[10,"unpack","","Unpack a single value of type `T`.",1,null],[10,"unpack_to_end","","Unpack values of type `T` until `EOF` is reached and place them in `buf`. An error is\nreturned if the number of bytes read is not a multiple of the size of `T`.",1,null],[10,"unpack_exact","","Unpack the exact number of values of type `T` to fill `buf`. An error is\nreturned if not enough byte could be read.",1,null],[8,"Packer","","`Packer` provides the `std::io::Write` API but for any type `T` implementing\n[`Packed`](trait.Packed.html). It does not perform any endianness conversion and thus always \nwrites data using the system endianness.",null,null],[10,"pack","","Pack a single value of type `T`.",2,null],[10,"pack_ref","","Pack a single value of type `T` passed by reference.",2,null],[10,"pack_all","","Pack all the values of type `T` from `buf`.",2,null],[8,"LEUnpacker","","Provides the same API and functionnality as [`Unpacker`](trait.Unpacker.html) but ensure that\nthe data is in little endian format. See [`Unpacker`](trait.Unpacker.html) for more \ndocumentation.",null,null],[10,"unpack","","",3,null],[10,"unpack_to_end","","",3,null],[10,"unpack_exact","","",3,null],[8,"LEPacker","","Provides the same API and functionnality as [`Packer`](trait.Packer.html) but ensure that\nthe data is in little endian format. See [`Packer`](trait.Packer.html) for more \ndocumentation.",null,null],[10,"pack","","",4,null],[10,"pack_ref","","Here T needs to be `Clone` because the endianness switch cannot be done in-place. This method\nthus allocates a copy of `buf` if an endianness switch is needed.",4,null],[10,"pack_all","","Here T needs to be `Clone` because the endianness switch cannot be done in-place. This method\nthus allocates a copy of `buf` if an endianness switch is needed.",4,null],[8,"BEUnpacker","","Provides the same API and functionnality as [`Unpacker`](trait.Unpacker.html) but ensure that\nthe data is in big endian format. See [`Unpacker`](trait.Unpacker.html) for more \ndocumentation.",null,null],[10,"unpack","","",5,null],[10,"unpack_to_end","","",5,null],[10,"unpack_exact","","",5,null],[8,"BEPacker","","Provides the same API and functionnality as [`Packer`](trait.Packer.html) but ensure that\nthe data is in big endian format. See [`Packer`](trait.Packer.html) for more \ndocumentation.",null,null],[10,"pack","","",6,null],[10,"pack_ref","","Here T needs to be `Clone` because the endianness switch cannot be done in-place. This method\nthus allocates a copy of `buf` if an endianness switch is needed.",6,null],[10,"pack_all","","Here T needs to be `Clone` because the endianness switch cannot be done in-place. This method\nthus allocates a copy of `buf` if an endianness switch is needed.",6,null]],"paths":[[8,"Packed"],[8,"Unpacker"],[8,"Packer"],[8,"LEUnpacker"],[8,"LEPacker"],[8,"BEUnpacker"],[8,"BEPacker"]]};
